class Solution {
public:
    int maxOperations(string& s) {
        vector<int> ones;
        int n=s.size(),ans=0,prev=0;
        for(int i=0;i<n-1;i++){
            if(s[i]=='0' && s[i+1]=='1') ans+=prev;
            if(s[i]=='1') prev++;
        }
        if(s.back()=='0') ans+=prev;
        return ans;
    }
};
